import React from 'react'
import { Container } from 'react-bootstrap';
import products from '../products';

function ProductScreen({match}) {
    const product= products.find((p)=> p._id==match.params.id)
    return (
        <Container>
          {product.name}
        </Container>
    )
}

export default ProductScreen;
